-- DROP TABLE "chess"."play";
CREATE TABLE "chess"."play" (
    "time_user" timestamp without time zone,
    "user_color" character varying,
    "user_id" integer NOT NULL,
    "game_id" integer NOT NULL,
    CONSTRAINT "play_game_id_fkey" FOREIGN KEY (game_id) REFERENCES game(game_id),
    CONSTRAINT "play_pkey" PRIMARY KEY (user_id, game_id),
    CONSTRAINT "play_user_id_fkey" FOREIGN KEY (user_id) REFERENCES users(user_id)
) WITHOUT OIDS;


-- Indexes

CREATE UNIQUE INDEX play_pkey ON play USING btree (user_id, game_id);
